import React, { Component } from 'react';
import './mainVoteContent.css';

class mainVoteContent extends Component {
  render(){
    return (
      <header>
        <div class="JM_VOTE_CONTENT">
          <div class="content_1">
            <div class="cont1_part1">
              <img class="cont_img"></img>
            </div>
            <div class="cont1_part2">
              <div class="cont_join_count"></div>
              <div class="cont_title"></div>
              <div class="cont_update_date"></div>
              <div class="cont_update_cont"></div>
            </div>
            <div class="cont1_part3">
              <div class="cont_writer"></div>
              <button class="share_cont"></button>
              <button class="love_cont"></button>
            </div>
          </div>
        </div>
      </header>
    );
  }
}

export default Subject;
